class MockVfb:
    def __init__(self, master_count: int, platform: str = "macos") -> None:
        self.num_masters = master_count
        self.writer_platform = platform


class BackgroundBitmapParserParserTest(TestCase):
    def test(self) -> None:
        result = BackgroundBitmapParser().parse_hex(bitmap_bin, MockVfb(1, "windows"))
        assert result == bitmap_raw

    def test_read(self) -> None:
        parser = BaseBitmapParser()
        parser.stream = BytesIO(deHexStr(rle_bin))
        result = parser._read_bitmap(20)
        assert result == rle_dec

    def test_decode(self) -> None:
        parser = BaseBitmapParser()
        # We need to copy the rle_dec to avoid modifying it
        result = parser._decode_bitmap(deepcopy(rle_dec))
        assert len(result) == len(expanded)
        assert result == expanded

    def test_decode_big(self) -> None:
        parser = BaseBitmapParser()
        result = parser._decode_bitmap(rle_big_dec)
        assert len(result) == len(rle_big_expanded)
        assert result == rle_big_expanded
